import React, { useState, useEffect } from "react";
import axios from "axios";

const YouTube = () => {
  const [channelData, setChannelData] = useState(null);
  const [videos, setVideos] = useState([]);
  const [loading, setLoading] = useState(true);
  const [pageToken, setPageToken] = useState("");
  const [nextPageToken, setNextPageToken] = useState("");
  const [prevPageToken, setPrevPageToken] = useState("");
  const [uploadsPlaylistId, setUploadsPlaylistId] = useState("");

  const API_KEY = "YOUR_YOUTUBE_API_KEY"; // Replace with your YouTube API key
  const CHANNEL_ID = "UCSqX6nd5ITl3b9oFGpDPA"; // Your YouTube Channel ID
  const VIDEOS_PER_PAGE = 12;

  useEffect(() => {
    const fetchChannelData = async () => {
      try {
        const response = await axios.get(
          `https://www.googleapis.com/youtube/v3/channels?part=snippet,statistics,contentDetails&id=${CHANNEL_ID}&key=${API_KEY}`
        );
        const data = response.data.items[0];
        setChannelData(data);
        setUploadsPlaylistId(data.contentDetails.relatedPlaylists.uploads);
      } catch (error) {
        console.error("Error fetching channel data:", error);
      }
    };
    fetchChannelData();
  }, []);

  useEffect(() => {
    if (!uploadsPlaylistId) return;

    const fetchVideos = async () => {
      setLoading(true);
      try {
        const videoResponse = await axios.get(
          `https://www.googleapis.com/youtube/v3/playlistItems?part=snippet&playlistId=${uploadsPlaylistId}&maxResults=${VIDEOS_PER_PAGE}&pageToken=${pageToken}&key=${API_KEY}`
        );
        setVideos(videoResponse.data.items);
        setNextPageToken(videoResponse.data.nextPageToken || "");
        setPrevPageToken(videoResponse.data.prevPageToken || "");
        setLoading(false);
      } catch (error) {
        console.error("Error fetching videos:", error);
        setLoading(false);
      }
    };
    fetchVideos();
  }, [uploadsPlaylistId, pageToken]);

  const handleNextPage = () => nextPageToken && setPageToken(nextPageToken);
  const handlePrevPage = () => prevPageToken ? setPageToken(prevPageToken) : setPageToken("");

  return (
    <div className="min-h-screen bg-gray-50 py-10 px-4 sm:px-6 lg:px-8">
      <div className="max-w-7xl mx-auto">
        {/* Header */}
        <h1 className="text-4xl font-extrabold text-gray-900 mb-8 text-center">
          YouTube -{" "}
          <span className="text-red-600">@chiranjeevikumar1008</span>
        </h1>

        {/* Channel Info */}
        {channelData && (
          <div className="bg-white p-6 rounded-xl shadow-lg mb-8 transform transition hover:shadow-xl">
            <div className="flex items-center space-x-4">
              <img
                src={channelData.snippet.thumbnails.medium.url}
                alt="Channel Thumbnail"
                className="w-16 h-16 rounded-full"
              />
              <div>
                <h2 className="text-2xl font-semibold text-gray-900">
                  {channelData.snippet.title}
                </h2>
                <p className="text-gray-600 text-sm mt-1">
                  {channelData.snippet.description}
                </p>
              </div>
            </div>
            <div className="mt-4 grid grid-cols-1 sm:grid-cols-3 gap-4">
              <p className="text-gray-700">
                <span className="font-bold">{channelData.statistics.subscriberCount}</span> Subscribers
              </p>
              <p className="text-gray-700">
                <span className="font-bold">{channelData.statistics.videoCount}</span> Videos
              </p>
              <p className="text-gray-700">
                <span className="font-bold">{channelData.statistics.viewCount}</span> Views
              </p>
            </div>
            <a
              href="https://youtube.com/@chiranjeevikumar1008"
              target="_blank"
              rel="noopener noreferrer"
              className="mt-4 inline-block px-4 py-2 bg-red-600 text-white rounded-lg hover:bg-red-700 transition duration-300"
            >
              Visit Channel
            </a>
          </div>
        )}

        {/* Featured YouTube Short */}
        <div className="bg-white p-6 rounded-xl shadow-lg mb-8">
          <h2 className="text-2xl font-semibold text-gray-900 mb-4">
            Featured YouTube Short
          </h2>
          <div className="flex justify-center">
            <iframe
              src="https://www.youtube.com/embed/KMyZ6kIjc8Y"
              title="YouTube Short"
              className="w-full max-w-md h-64 rounded-lg"
              allowFullScreen
            />
          </div>
        </div>

        {/* Video List */}
        {loading ? (
          <div className="text-center">
            <div className="inline-block h-8 w-8 animate-spin rounded-full border-4 border-solid border-red-600 border-r-transparent" />
            <p className="text-gray-500 mt-2">Loading videos...</p>
          </div>
        ) : (
          <>
            <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
              {videos.length > 0 ? (
                videos.map((video) => (
                  <div
                    key={video.snippet.resourceId.videoId}
                    className="bg-white p-4 rounded-xl shadow-md hover:shadow-lg transition duration-300"
                  >
                    <div className="aspect-w-16 aspect-h-9">
                      <iframe
                        src={`https://www.youtube.com/embed/${video.snippet.resourceId.videoId}`}
                        title={video.snippet.title}
                        className="w-full h-full rounded-lg"
                        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
                        allowFullScreen
                      />
                    </div>
                    <p className="mt-3 text-sm font-medium text-gray-900 truncate">
                      {video.snippet.title}
                    </p>
                    <p className="text-xs text-gray-500">
                      {new Date(video.snippet.publishedAt).toLocaleDateString()}
                    </p>
                  </div>
                ))
              ) : (
                <p className="text-gray-500 col-span-full text-center">No videos found.</p>
              )}
            </div>

            {/* Pagination */}
            <div className="flex justify-between mt-8">
              <button
                onClick={handlePrevPage}
                disabled={!prevPageToken && pageToken === ""}
                className="px-5 py-2 bg-red-600 text-white rounded-lg disabled:bg-gray-300 disabled:cursor-not-allowed hover:bg-red-700 transition duration-300"
              >
                Previous
              </button>
              <button
                onClick={handleNextPage}
                disabled={!nextPageToken}
                className="px-5 py-2 bg-red-600 text-white rounded-lg disabled:bg-gray-300 disabled:cursor-not-allowed hover:bg-red-700 transition duration-300"
              >
                Next
              </button>
            </div>
          </>
        )}
      </div>
    </div>
  );
};

export default YouTube;
